import React from 'react';

const CardList = () => {
  return (
    <div className="popular-container">
      <h2>Популярное</h2>
      <div className="card-list">
        <Card imageUrl="url_картинки_1" />
        <Card imageUrl="url_картинки_2" />
        <Card imageUrl="url_картинки_3" />
        <Card imageUrl="url_картинки_4" />
      </div>
    </div>
  );
};

const Card = ({ imageUrl }) => {
  return (
    <div className="card">
      <img src={imageUrl} alt="Комплектующее ПК" className="card-image" />
    </div>
  );
};

export default CardList;
